9jTkpeXLm8E	Quick Pressure Cooker KHEER Recipe with JAGGERY PUDA (Malpua) | ‡§™‡§Ç‡§ú‡§æ‡§¨‡•Ä ‡§ñ‡•Ä‡§∞ ‡§™‡•Å‡§°‡•á‡§º | Sanjyot Keer	Black Bowl - https://links.yflhome.com/yflhomeblackbowlyt\n\nFull written recipe - Punjabi Kheer Puda\n\nPrep time: 30-40 minutes (includes soaking & resting time)\nCooking time: 40-45 minutes\nServes: 5-6 people\n\nKheer\nIngredients:\nTUKDA BASMATI | ‡§ü‡•Å‡§ï‡§°‡§º‡§æ ‡§¨‡§æ‡§∏‡§Æ‡§§‡•Ä 1/4 CUP\nWATER | ‡§™‡§æ‡§®‡•Ä AS REQUIRED (for washing & soaking the rice)\nMILK | ‡§¶‡•Ç‡§ß 1 LITRE (FULL FAT)\nCONDENSED MILK | ‡§ï‡§Ç‡§°‡•á‡§Ç‡§∏‡•ç‡§° ‡§Æ‡§ø‡§≤‡•ç‡§ï 200 ML / 275 GRAMS\nALMONDS | ‡§¨‡§æ‡§¶‡§æ‡§Æ 1/4 CUP (SOAKED, PEELED & SLICED)\nMethod:\nWash & soak the rice in a bowl for 15-20 minutes. Then discard the water & add the soaked rice into a pressure cooker.\nFurther add the milk & stir it well. Put the cooker‚Äôs lid on & cook over high flame for exactly 5 minutes or until the pressure builds, then place the cooker on the smallest burner & cook it over the lowest flame for 30 minutes.\nThen switch off the flame & let the cooker de-pressurize naturally. Open the pressure cooker‚Äôs lid & stir the kheer, the milk will have reduced & the colour has changed slightly. Switch on the flame & bring the kheer to a boil.\nFurther add the condensed milk & cook the kheer further, if you are going to serve it hot then cook it until the desired consistency is achieved, but if you are going to serve it cold then keep it slightly runny as the kheer will thicken up significantly once cooled. So, if you are going to serve it chilled, do no cook it for more them 6-8 minutes.\nLastly add the slivered almonds & your delicious Kheer is ready. Bring it down to room temperature & keep it in the fridge while you make the Puda.\n\nJaggery Pude\nIngredients:\nJAGGERY | ‡§ó‡•Å‡§°‡§º 1/2 CUP OR 80 GRAMS (CHOPPED)\nHOT WATER | ‡§ó‡§∞‡§Æ ‡§™‡§æ‡§®‡•Ä 1 CUP \nSAFFRON | ‡§ï‡•á‡§∏‡§∞ A FEW STRANDS\nWHEAT FLOUR | ‡§ó‡•á‡§π‡•Ç‡§Ç ‡§ï‡§æ ‡§Ü‡§ü‡§æ 1 CUP / 120 GRAMS\nFENNEL SEEDS | ‡§∏‡•å‡§Ç‡§´ 2 TSP (COARSELY CRUSHED)\nCARDAMOM POWDER | ‡§á‡§≤‡§æ‡§Ø‡§ö‡•Ä ‡§™‡§æ‡§â‡§°‡§∞ 1/4 TSP\nBLACK PEPPERCORNS | ‡§∏‡§æ‡§¨‡•Å‡§§ ‡§ï‡§æ‡§≤‡•Ä ‡§Æ‡§ø‡§∞‡•ç‡§ö 1 TSP (COARSELY CRUSHED)\nSALT | ‡§®‡§Æ‡§ï A PINCH\nWATER | ‡§™‡§æ‡§®‡•Ä 3 TBSP OR AS REQUIRED (for adjusting consistency of the batter)\nGHEE | ‡§ò‡•Ä AS REQUIRED (for cooking)\nMethod:\nAdd the hot water to the jaggery & add the saffron strands as well, stir it & let it rest for a couple of minutes until the jaggery melts completely & the water comes down to room temperature.\nMeanwhile, add the wheat flour into a large bowl along with all the remaining fry ingredient & mix well.\nOnce the jaggery melts, add the jaggery water gradually into the bowl & whisk well to make lump-free smooth batter. Once you have added all the jaggery water & if the batter seems too thick, you can add more water, 1 tablespoon at a time, it should be a semi-thick flowing batter.\nCover & let the batter rest for 30 minutes.\nTo cook the puda, I prefer to shallow fry them on a tawa. Set a tawa over high flame & let it get got, then add 1-2 teaspoons of ghee & let it heat up.\nFurther pour a small ladle full of the batter, it will form into a circular shape on its own. I like to make mini pude, you can adjust the size as per your preference by adding more or less batter at a time. If you are making mini pude then you can cook multiple at a time like how I have.\nCook the pude over medium high flame until the turn crisp from once side, then flip & cook them similarly on the other side.\nYour deliciousPudas are ready, serve them hot with some chilled kheer\n\n#yfl #SanjyotKeer #kheer #pude #malpua \n\nFollow Your Food Lab on:\n\nhttps://www.instagram.com/yourfoodlab/\nhttps://www.facebook.com/yourfoodlab/\n\n\nFollow my personal handles here: (Chef Sanjyot Keer) \n\nhttps://www.instagram.com/sanjyotkeer/\nhttps://www.facebook.com/sanjyotkeerofficial/\nhttps://x.com/sanjyotkeer\n\nThe Music I use in All my video