AkLEWtsmnJA	Sindhi Kadhi + Bhuga Chawal + Arbi Tuk | Complete Sindhi Thali Recipe by Smita Deo	What‚Äôs in Today‚Äôs Sindhi Thali?\n1. Sindhi Kadhi\nA tangy, nourishing gram flour-based curry loaded with seasonal vegetables, slow-cooked to perfection and finished with a fragrant ghee tadka. It‚Äôs comfort in a bowl!\n\n2. Bhuga Chawal\nThis aromatic rice dish is cooked with caramelized onions, warming spices, and green chillies for a subtly spicy, earthy base that perfectly complements the kadhi.\n\n3. Arbi Tuk\nCrispy outside, soft inside‚Äîthese smashed colocasia discs are fried, spiced with turmeric, chilli, and amchur, and shallow-cooked for maximum flavour and crunch.\n\nWhile these may seem like familiar names, what I‚Äôm sharing today is my personal take on the Sindhi Thali - with tips, techniques, and love passed down from dear friends and home-kitchen wisdom.\n\nIngredients Used\nüëâ Sindhi Kadhi\nGhee ‚Äì 4 tbsp\nMustard Seeds ‚Äì 1 tsp\nCumin Seeds ‚Äì 1 tsp\nFenugreek Seeds ‚Äì ¬Ω‚Äì1 tsp\nCrushed Coriander Seeds ‚Äì 1 tbsp\nCurry Leaves ‚Äì 1 sprig\nGram Flour (Besan) ‚Äì 1¬Ω cups\nTomatoes (boiled & pur√©ed) ‚Äì 5\nRed Chilli Powder ‚Äì 1 tbsp\nCoriander Powder ‚Äì 1 tbsp\nWater ‚Äì ¬Ω litre\nVegetables: Carrot, Drumstick, Potato, Brinjal, Cluster Beans ‚Äì 100g each\nOkra (Bhindi) ‚Äì 100g (lightly saut√©ed in ghee)\nTamarind Pulp ‚Äì 2 tbsp\nSalt ‚Äì to taste\n\nüëâ Bhuga Chawal\nGhee ‚Äì 3 tbsp\nBay Leaves ‚Äì 2\nCinnamon ‚Äì 1 inch\nGreen Cardamoms ‚Äì 3\nCloves ‚Äì 3\nBlack Peppercorns ‚Äì 10\nSliced Onions ‚Äì 3\nRed Chilli Powder ‚Äì ¬Ω tsp\nGreen Chillies ‚Äì 3 slit\nBasmati Rice (soaked) ‚Äì 2 cups\nSalt ‚Äì 1¬Ω tsp\nWater ‚Äì 4 cups\nTadka for Bhuga Chawal:\nGhee ‚Äì 1 tbsp\nMethi ‚Äì ¬º tsp\nMustard Seeds ‚Äì ¬Ω tsp\nCumin Seeds ‚Äì ¬Ω tsp\nCurry Leaves ‚Äì a sprig\n\nüëâ Arbi Tuk\nArbi (Colocasia) ‚Äì ¬Ω kg (boiled, peeled)\nOil ‚Äì for frying\nTurmeric Powder ‚Äì ¬æ tsp\nRed Chilli Powder ‚Äì 1 tbsp\nRaw Mango Powder (Amchur) ‚Äì 1 tbsp\nSalt ‚Äì to taste\nOil ‚Äì for pan-frying\n\n\nStep-by-Step Cooking Instructions\nSindhi Kadhi\n- In ghee, splutter mustard, cumin, methi, crushed coriander, and curry leaves.\n- Add gram flour and roast on low until aromatic.\n- Stir in tomato pur√©e and spices.\n- Gradually add water and vegetables (except bhindi).\n- Fry bhindi separately and add once veggies are partly cooked.\n- Add tamarind pulp, cook till everything is tender.\n- Finish with a separate ghee tadka for extra flavour and aroma.\n\nBhuga Chawal\n- Heat ghee, add whole spices, then sliced onions.\n- Cook onions till golden brown.\n- Add soaked rice, salt, red chilli powder, green chillies.\n- Add water, cover and cook till done.\n- Fluff the rice and give a final tempering if desired.\n\nArbi Tuk\n- Boil, peel, and deep-fry arbi till golden.\n- Gently smash them and toss with dry spices.\n- Pan-fry with a drizzle of oil till crisp on both sides.\n\nThis Sindhi-style vegetarian thali is not just delicious - it‚Äôs also deeply rooted in tradition, loaded with fibre and plant protein, and perfect for festive as well as everyday meals. Whether you're a fan of regional Indian food or exploring authentic Sindhi cuisine, this recipe is a must-try.\n\n___________________________________________\n\nSindhi thali recipe | Sindhi kadhi recipe | Bhuga chawal recipe | Arbi tuk recipe | Sindhi food | vegetarian Indian thali | traditional Indian lunch | gram flour curry | Smita Deo recipes | comfort food India | regional thali India | how to make Sindhi kadhi at home\n___________________________________________\n\nDon‚Äôt forget to LIKE, COMMENT, and SUBSCRIBE to the channel for more soulful Indian recipes!\n\n#SindhiThali #SmitaDeo #sindhikadhi  #BhugaChawal #ArbiTuk #IndianThaliRecipes #VegetarianIndianThali #traditionalindianfood  #homecookedwithlove  #SmitaDeoRecipes	https://www.youtube.com/watch?v=AkLEWtsmnJA	https://i.ytimg.com/vi/AkLEWtsmnJA/hqdefault.jpg	youtube	scraped	UC2JiOaDae2GysL-_mSL7pwQ	Smita Deo	2025-06-16 13:12:40	15672	503		801	t
